INSERT INTO `sed_item_competencia` VALUES (1,'1. Formación, Capacitación y Desarrollo','Mide la motivación del servidor público para el mejoramiento continuo a través de estudios, cursos, lectura y cualquier otra actividad individual u organizacional que asegure su evolución personal y profesional además de cumplir con la aprobación en el semestre de un curso avalado por el Ministerio con competencias en planificación.',5),(2,'2. Servicio Valor','Mide el grado en que los procesos de trabajo y las relaciones con el colectivo del servidor público reflejan el interés por satisfacer los requerimientos de los usuarios externos e internos ofreciéndoles un servicio eficiente.',7),(3,'3.Capacidad para innovar','Es la capacidad para ofrecer creatividad y originalidad. Un estilo innovador permite pensar de qué manera se puede mejorar en el futuro. ',2),(4,'4. Fortalece la relaciones de trabajo','Mide la habilidad del servidor público para interactuar en forma cordial, amable y proactiva, tanto individual como colectivamente',7),(5,'5. Entender y Aplicar Normas','Identificación con las políticas, reglamentos y códigos de conducta que regulan todos los aspectos de las responsabilidades inherente al desempeño del cargo y conducta apropiada en la organización.',6),(6,'6. Alentar acción colectiva','Habilidad del servidor público de infundir al colectivo organizacional la aplicación de acciones acertadas en situaciones determinadas',7),(7,'7. Hábitos de Seguridad ','Cumplimiento de las normas y procedimientos establecidos por la organización para proteger la integridad física y mental del servidor público',2),(8,'8. Compromiso sobre los recursos','Mide el grado de responsabilidad del servidor publico por la conservación, uso y mantenimiento de los bienes materiales, herramientas y equipos asignados a su área y en otras de la organización, con la finalidad de optimizar su utilidad y beneficio tanto individualmente como colectivamente. ',2),(9,'9. Oportunidad y Tíempo','Mide el grado de capacidad del servidor público por gestionar en forma consistente, rápida y directa los requerimientos individuales y colectivos de los usuarios internos y externos',5),(10,'10. Transparencia de la Comunicación','Mide la habilidad del servidor público para recibir, comprender y transmitir en forma oral y escrita ideas e información de manera que facilite la rápida comprensión, logrando una actitud positiva en cualquier situación de trabajo.',2),(11,'11. Cooperación y trabajo en Colectivo. ','Capacidad del servidor público para cooperar y prestar ayuda o asistencia para el logro de los fines organizacionales.',5);
/*!40000 ALTER TABLE `sed_item_competencia` ENABLE KEYS */;
UNLOCK TABLES;

